// src/App.js

import React from 'react';
import './App.css';
import LocationSearch from './components/LocationSearch';
import SimpleMap from './components/BasicMap';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Weather Visualization</h1>
            </header>
            <main>
            <LocationSearch />
            <SimpleMap style={{ justifyContent:'center', alignItems:'center'}}></SimpleMap>
            </main>
        </div>
    );
}

export default App;
